window.bookSummaryJSON = "<p><b>A dark and stormy night.... </b></p> <p>As a hurricane bore down on the Eastern Shore, Sheriff Liam Sullivan patrolled the roads, glad to see everyone was staying inside. Everyone except the owner of the car towing a trailer, now sitting on the side of the road, lights flashing.</p> <p>And then he met her. A woman in need. A woman to rescue. A woman to protect. A woman to love.</p> <p>Now to convince her of that.</p> <p>Scenes and language similar to an R-rated movie. 18+ listeners only.</p> <p><b>Baytown Boys</b>â€¦. Military duty called them away to war zones, but after tours overseas, the group of friends found their way back home as men, seeking the peaceful little seaside town. Now, the band of brothers, together once more, work to provide a place for less fortunate veterans to call home.</p>"; 
